import React, { Component } from 'react';
import logo from '../../logo.svg';
import './Header.css';

export default class Header extends Component {
    constructor() {
        super();
        this.state = {
            red: true,
            tile1: "red"
        };
    }

    render() {
        return (
            <div className="nav-wrap">
                <a href="" className="logo">Logo/Brand</a>
                <div className="nav">
                        <button>bOne</button>
                        <button>bTwo</button>
                        <button>bThree</button>
                        <button>bFour</button>         
                </div>
            </div>
        );
    }
}
